sbol:ComponentDefinition.sbh:mutableDescription:
ptrp is a promoter with the trp operator. It will be repressed by trpR (K588000) and LovTAP.
Note that the original trp operator contains two SpeI sites&#12290;
We remove the illegal sites without affecting its function by site-directed mutagenesis for meeting the requirements of RFC10 and more convenient to be assembled, and finally constructed three ptrp muant, called ptrp mutant1, ptrp mutant2, and ptrp mutant3.
